const fil = {
  name: "Бумага",
  path: "paper",
  subMenu: [
    {
      subList: [
        "Для самокруток",
        "Бля кальяну",
        "Для люльки",
        "Нюхальний табак",
      ],
    },
  ],
};
const fl = { ...fil };
fl.name = "Гільзи";
fl.path = "hilzy";
const f = { ...fil };
f.name = "Фільтри";
f.path = "filter";
const f1 = { ...fil };
f1.name = "Аромати";
f1.path = "aroma";
const f2 = { ...fil };
f2.name = "Машинки";
f2.path = "mashine";

export const menuItems = [fil, fl, f, f1];
